import React from "react";
import { getTodos } from "../redux/selectors"; // Corrected spelling here
import { connect } from "react-redux";

const VisibilityFilter = ({ todos }) => {
  console.log("todo :", todos);

  const showAll = () => {
    return todos.inputData; // Corrected the logic here
  };

  return (
    <div>
      <h2>VISIBILITY FILTER</h2>
      <button onClick={() => showAll()}>All</button>
      <button onClick={() => showAll()}>Completed</button>
      <button onClick={() => showAll()}>Not Completed</button>

      {todos.inputData.map((todo) => ( // Corrected mapping here
        <div key={todo.id}>
          <h6>{todo.inpputData}</h6> {/* Typo in "inputData" */}
        </div>
      ))}
    </div>
  );
};

const mapStateToProps = (state) => ({
  todos: getTodos(state),
});

export default connect(mapStateToProps)(VisibilityFilter);
